    <div className="input-wrapper">
        {/* <p>{props.label}</p> */}
        <input type={props.type} placeholder={props.placeholder} required/>

        <style jsx>{`
        div{
            margin: 10px;
        }

        input{
            width: 100%;
            font-size: 1.2rem;
            box-sizing:border-box;
            padding: 3px;
            align-self: center;
        }
		`}</style>
    </div>
);

export default Input;
